import React, {Component} from 'react';
import '../bootstrap.min.css';
import '../App.css';
import axios from 'axios'
class Table extends Component {
  constructor(props){
    super(props)
    this.state = {
      showFunc : props.showFunc,
      showing : props.showing,
      path: props.path,
      data: []
    }
    this.handleHomeClick = this.handleHomeClick.bind(this)
  }
  componentWillMount(){
    axios.post('/filedataoffset', {path : this.state.path})
    .then((res)=>{
        this.inputRef.current.value = ''
        this.state.showFunc()
    })
    .catch((err) => {
        console.log(err)
        this.inputRef.current.value = ''
    })
  }

  handleHomeClick(e) {
    e.preventDefault();
    // this.setState({
    //   activePage: 1,
    //   active100: 1,
    //   perPage: 5,
    //   path: '',
    //   data: [],
    //   sortBy: '_id',
    //   sorting: 'asc',
    //   searchQuery: null,
    // })

    this.state.showFunc();
  }
  render() {
    let styleT = {};
    if(!this.props.showing)
      styleT = {display: "none"};
    return (
      <div style={styleT} className="">
          <button className="btn btn-primary back-btn" onClick={this.handleHomeClick}>Home</button>
        <p>NESTO!</p>
      </div>
    )
  }
}

export default Table;
